import React from "react";
import { Link } from "react-router-dom";
import "./Home.css";
import { defaultImgs } from "../defaultimgs";

const Home = () => {
  return (
    <>
      <div className="mainContect">
        <div className="profileTweet">
          <img src={defaultImgs[0]} className="profilePic"></img>
        </div>
      </div>
    </>
  );
};

export default Home;
